import '../css/Shared/page3.css';

const Profile = (props) => {
    return (
        <div id = "Profile">
            <div>
                <SideBar></SideBar>
            </div>
            <div id = "profileMiddle">
                <div id = "innerProfileMiddle">
                <ProfileHeader></ProfileHeader>
                <Line></Line>
                <Friends></Friends>

                </div>
            </div>
            <div id = "profileEnd">
                <UserSettingsButton></UserSettingsButton>
                <SuggestedFriends></SuggestedFriends>
            </div>
        </div>
      );
}

export default Profile;
